In a year where role models like Kobe and Chadwick have passed away, I always worry about life and my legacy, I worry about the valuable moments I miss, I wonder what my son will learn from me.  I realise that even Instagram is a biography of our lives (or at least a place where we share our mindset)

I hope my son works out that his father loves him, will always work on getting better every day, will still work hard and is focussed on building a legacy for him to leave his mark in the world.

Those of you who have been part of my life journey, know that I understand how precious life is.  As a son, I have to say I have no regrets with my father (that I was blessed that he knew I loved him, that there was no conversation left pending when he passed ten years ago). Still, for whatever reason, I broke a promise to myself, I wanted a life of no regrets, to never leave a stone unturned, but this is where I failed.

It's never easy to express how you feel, and especially when your child is young, how do you tell him how you feel.  So, a little 2020 trick that has helped, whenever I feel like climbing a mountain and shouting how I feel, I record a video.  I find it a perfect way of leaving him a message; it feels like he can hear me :). I find it a good way of knowing that there will always be a video in my phone telling those I love exactly how I feel. 

My dear friend's life is short and precious; I sincerely hope you all have a healthy and long life, but please remember legacy is not just money, values, or a way of life, it's also the knowledge that you are and were loved.

As I work, watch the NBA playoffs, I wanted to make sure my friends learn a little from the lessons I have learnt in 2020.

Please, please make the most of this life and please be the best you.

