This year I have not strived for perfection, but to rebuild myself into the person I needed to become, I found that there was no shortcut, there was no easy way out.

What I can share after eight months of this journey, is that your most formidable opponent is standing in the one looking you in the mirror (Get out of your way, believe in yourself, stay disciplined and work for what you want). You will always win that war because you know where you went wrong, how much harder you can work and that knowledge tomorrow the game starts again.

I know there is no competition in my life, no one can outwork me, I can take the hits, no one else is limitless and fundamentally how many people are willing to die for what they believe in.

Music, Motivation have played their part, those of you who know my playlist, you will know it is full of songs that move me, audiobooks that educate me, motivation clips that inspire me and those “Rocky” clips that keep me fighting.

So today, I feel obliged to tell you to go “One More Round.”

Because no matter how disheartened you are, no matter what you go through, no matter how much you miss those you love, or no matter how much you feel you cannot breathe… there is only one way go forward by going “One More Round.”

